import styled from "styled-components"

const LogoStyled = styled.div`
    font-family: 'Roboto', sans-serif;
    font-weight: 700;
    font-size: 24px;  
    padding-left: 20px;
    `

function Logo () { 
    return (
        <LogoStyled className="logo">
            <h1>Banco</h1>
        </LogoStyled>
    )
}

export default Logo
